  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Members can make a number of different proposals including:`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`Membership`}</strong>{` - Tributing capital and Requesting new shares to join the DAO`}</li>
      <li parentName="ul"><strong parentName="li">{`Funding`}</strong>{` - Tributing Spoils or Requesting funds from the DAO to work on internal projects and improvements`}</li>
      <li parentName="ul"><strong parentName="li">{`Token`}</strong>{` -  Request to add support for a new ERC20 token`}</li>
      <li parentName="ul"><strong parentName="li">{`Trade`}</strong>{`  - Request the DAO to swap one asset for another within the War Chest`}</li>
      <li parentName="ul"><strong parentName="li">{`GuildKick`}</strong>{` - Request to forcibly remove a malicious member through a vote`}</li>
      <li parentName="ul"><strong parentName="li">{`Minion`}</strong>{` - A contract that allows execution of arbitrary calls i.e swapping assets in War Chest`}</li>
    </ul>
    <h3 {...{
      "id": "proposal-process"
    }}>{`Proposal Process`}</h3>
    <p>{`To submit a proposal, navigate to the `}<a parentName="p" {...{
        "href": "https://app.daohaus.club/dao/0x64/0xfe1084bc16427e5eb7f13fc19bcd4e641f7d571f"
      }}>{`Raid Guild DAO`}</a>{` and select “View Proposals” followed by New Proposal.`}</p>
    <p>{`Select the Proposal Type (described above) and fill in all fields. Here are some of the things you’ll want to keep in mind when filling out a proposal.`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`TITLE:`}</strong>{` Enter a description of the proposal. Example: New Member - Igor Bogdanoff`}</li>
      <li parentName="ul"><strong parentName="li">{`DESCRIPTION:`}</strong>{` Anything you believe is relevant to your proposal. The shorter the description the better, and the important piece here is the `}<em parentName="li">{`WHAT`}</em>{` you are asking for and `}<em parentName="li">{`WHY`}</em>{`.`}</li>
      <li parentName="ul"><strong parentName="li">{`LINK:`}</strong>{` Whatever information gives us the best context to review your proposal and make an informed decision.`}</li>
      <li parentName="ul"><strong parentName="li">{`APPLICANT`}</strong>{` With respect to funding proposals, this is the recipient or sender address you would like to have funds sent to or from.  `}</li>
      <li parentName="ul"><strong parentName="li">{`PAYMENT REQUESTED:`}</strong>{` The number of Shares requested. Every Raid Guild Share is equal to 5 wxDAI. New membership proposals may request a maximum of 100 shares for a total of 500 wxDAI.`}</li>
      <li parentName="ul"><strong parentName="li">{`+REQUEST SHARES:`}</strong>{` Voting shares in the DAO. If it is a funding proposal, Members can request payment be made in shares up to 20% of the total amount requested.`}</li>
      <li parentName="ul"><strong parentName="li">{`+REQUEST LOOT:`}</strong>{` Non-voting shares in the DAO. This means you will have shares which can be raqequit but do not hold voting rights. Loot shares cost the same as regular shares at 5 wxDAI/share.`}</li>
      <li parentName="ul"><strong parentName="li">{`GIVE TRIBUTE:`}</strong>{` The amount of capital you are committing to deposit to the War Chest. (Tribute is relevant to Membership and Funding Proposals).`}</li>
    </ul>
    <p>{`After submitting a proposal, it will enter the `}<strong parentName="p">{`Unsponsored Proposals`}</strong>{` section. This means someone with shares (which could be you) must Champion the proposal in order for it to be moved to voting.`}</p>
    <p><em parentName="p">{`Note: You can sponsor your own Proposal, but it is recommended that you have another member sponsor it so they can make sure you have filled out the proposal with the correct information and you get the result you intended for.`}</em></p>
    <h3 {...{
      "id": "processing"
    }}>{`Processing`}</h3>
    <p>{`Once the proposal has been sponsored it will enter the `}<strong parentName="p">{`Queue`}</strong>{`. The queue ensures proposals are funneled to voting in an orderly fashion. One proposal will go from the queue to the Voting Period once every two hours.`}</p>
    <p>{`Once in the `}<strong parentName="p">{`Voting Period`}</strong>{`, members can now vote on the proposal. Every proposal has a 72 hour voting period in which it must receive more Yes than No votes to pass.`}</p>
    <p>{`After voting has ended, the proposal enters a `}<strong parentName="p">{`Grace Period`}</strong>{` which gives members time to ragequit if they do not like the outcome of the vote. The grace period lasts 48 hours.`}</p>
    <p>{`Next, The proposal is sent to `}<strong parentName="p">{`Processing`}</strong>{` in which the vote is time stamped on-chain.`}</p>
    <p>{`After being processed, the proposal is marked as `}<strong parentName="p">{`Completed`}</strong>{`, and all shares, funds or outcomes are executed as specified in the proposal. All outcomes of a proposal that affect you can be viewed by clicking your Address (top right) and selecting `}<strong parentName="p">{`View Member Profile`}</strong>{`.`}</p>
    <h3 {...{
      "id": "claiming"
    }}>{`Claiming`}</h3>
    <p>{`For members that received Funding, you will need to withdraw the funds from the DAO contract under Internal Balances (viewable from Member Profile).`}</p>
    <p><em parentName="p">{`Note: If you mess up your proposal, you can cancel it while in it remains Unsponsored. To do so, click the proposal and hit Cancel at the bottom. Any tribute can be withdrawn from Internal Balances to resubmit with the correct amount(s).`}</em></p>
    <h3 {...{
      "id": "contract-addresses"
    }}>{`Contract Addresses`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
